            lastIndex = choosedTexts.length - 1;
        let texttmp = choosedTexts[lastIndex],
            sourceIdtmp = data.ca(i.np(i.attr(form,'property>0>temp>s:text')));

        //240613，对于连线操作表单，不选择操作任何属性时，temp>s:text值默认是TEXT这个字符串！不做识别处理，会报错！
