        if (notNumberType) {
            if (!data.ca('checkSelected') || data.ca('checkSelected').length == 0) {
                return; //240613，确实为未勾选任何操作属性的情况，直接return掉，不继续！
            } else console.assert(0);
        }
        sourceIdtmp = Number(sourceIdtmp);

        //如果选中节点，那么就是清除反向关联绑定
        if(isArrayFn(texttmp)) texttmp = null;

        /*230924，对话框的onCancel，点击取消时，会设置没有反向关联'onCancel'的操作值为~对外。
        这里为了避免下面以为oldVal为array而报错！*/
        if(val == '~' && oldVal == '~') return undefined;

        /*240609，反向关联属性，为了不影响显示给用户的名称关联，这里把属性的关联直接应用操作到被操纵属性
        连线属性树表的rowData中，原先索引0~3分别是翻译名、值、属性名、描述，现在在索引为4的地方，放上关联属性名（非翻译名）！*/
        let currentClickedTmp = form['a:property>0>treeTable-ui1>a:currentClicked'],   //240621，有必要这样，因为可能是取消某个关联，此时选中为null。否则会导致无法取消、做空关联！
            currentAttrRelatived = currentClickedTmp && currentClickedTmp.rowData[2],
            sourceTargetAttrRowData = i.getTreeItemsById(node.ca('datas'),sourceIdtmp)[0].rowData;
        sourceTargetAttrRowData[4] = currentAttrRelatived;

        /*默认值填充为0，因为对于treeTable的a:lastItemRowsText，index为0的（首个元素）需要对应按钮组的索引
        通常只有一个按钮时候索引为0，因此若a:lastItemRowsText为null时，通过默认值0，实现自动填充*/
        return i.setIndexValue(oldVal,sourceIdtmp,texttmp,0);    
    case 1:
        break;
    case 2:
        break;
    default:
        break;
}

return val;}

