    return valtmp === undefined ? '（空值）' : (typeof(valtmp) == 'object' ? i.replaceAll(JSON.stringify(valtmp,undefined,2),'\n','<br>') : valtmp); //为了让undefined值也能显示，避免显示成注释了！
